import React, { Component } from 'react'

export class movie extends Component {
    constructor(props) {
        super(props)
        console.log(this.props.location.state)
        this.state = {
          result: this.props.location.state.result   
        }
    }

    render() {
        const {result}  = this.state
        return (
            <div>
                {result.Title}
            </div>
        )
    }
}

export default movie
